import React from 'react';
import { createBrowserRouter, RouterProvider, Route } from 'react-router-dom';

import HomePage from './HomePage';
import  ProjectPage from './ProjectPage';


const home = [<Route  path='/' component=  {HomePage} />];



const projetos = createBrowserRouter([{

  path: "/projetos",
  element : <ProjectPage/>

}])



function App() {
  return (
    <React.StrictMode>
    <RouterProvider router={home} routes={projetos} ></RouterProvider>
    </React.StrictMode>
  );
}

export default App;
